func Test_letterCasePermutation(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		sort.Strings(tc.ans)
		actual := letterCasePermutation(tc.S)
		sort.Strings(actual)
		ast.Equal(tc.ans, actual, "输入:%v", tc)
	}
}

func Benchmark_letterCasePermutation(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			letterCasePermutation(tc.S)
		}
	}
}
